            {products.map((product, index) => (
              <div
                key={product.id}
                className={`carousel-item ${index === currentIndex ? "active" : ""
                  }`}
              >
                <img src={product.image} alt={product.title} />
                <div className="product-info">
                  <h4>{product.title}</h4>
                  <span className="product-arrow">â†’</span>
